import styled from 'styled-components'
import * as appStyles from '../appStyle'


export const Content = styled.div`
    display : flex;
    justify-content : space-between;
    width : 100%;
    align-items : center;
    flex-flow : row wrap;
    margin : 20px 40px;

    h5{
        font-size : 24px;
        color : ${appStyles.mainText}
    }
`
